import Head from 'next/head';
import Navegacion from './Navegacion';

const MasterPage = (props) =>{
    return(
        <div>
            <Head>
                <title>Terabit</title>
            </Head>

            <Navegacion />

        {props.children}
    </div>
    )
};

export default MasterPage;
